env:
  browser: true
  es2021: true
extends: airbnb-base
overrides: []
parserOptions:
  ecmaVersion: latest
  sourceType: module
rules: {
  "no-console": "off",
  "no-eval": "off",
  "import/extensions": [
  "error",
  "ignorePackages",
  {
    "js": "ignorePackages",
    "jsx": "ignorePackages"
  }
]
}
